import Link from "next/link";
const Index = () => (
    <div>
         <nav>
        <Link href="/about"><button>About</button></Link>
        <Link href="/"><button>Home Page</button></Link>
        </nav>
        <h1>Welcome Next.js</h1>
       
    </div>
)

export default Index;
